import { css, StyleSheet } from 'aphrodite';

function Icons(props) {
	return (
		<div>
			<img className={css(style.icon)} src={props.src} alt={props.alt} />
		</div>
	)
}

const style = StyleSheet.create({
	icons: {
		width: '60px'
	}
})

export default Icons;
